    // const number = props.id;
    // const Watching = () =>{
    //     alert(`i m watching ${number} `);
    //     <Watchnow id = {number}/>;
    // };
    const [caa, setcaa] = useState([]);
     fetch("https://api.themoviedb.org/3/movie/popular?api_key=c9df0bb1b55da2720c721bcb3c0b5833").then((value)=>{
        // console.log(value);
       return value.json();
    }).then((currentdata)=>{
        // console.log(currentdata);
       const Carr = currentdata.results;
    //    console.log(Carr);
       setcaa(Carr);
    });
    
   
   const calling = () =>{
    console.log(caa);
   };
    return (
        <>
        <div className = {`container ${props.btao}`}>
            <div className = "images">
                <img src = {props.images} />
            </div>
            <div className = "sec">
            <div className = "about">
                <h3> {props.title}</h3>
                <p> {props.btao} </p>
                <p> {props.date}</p>
            </div>
            <div className = "buttons">
              
                <a href = "#" target = "_blank">Watch Now</a>
                {/* <a href = "/watch" >Wacthlist</a> */}
                <NavLink exact to="/watch"  >WatchList </NavLink>
            </div>
            </div>
        </div>
        </>
    )
}

export default Navbar;
